import React from 'react';
import { useNavigate } from 'react-router-dom';

function LandingPage() {
  const navigate = useNavigate();

  const goToLogin = () => {
    navigate('/login');
  };

  return (
    <div style={{
      height: '100vh',
      backgroundColor: '#f3f4f6',
      padding: '20px',
      position: 'relative',
    }}>
      {/* ログインボタン（右上） */}
      <button
        onClick={goToLogin}
        style={{
          position: 'absolute',
          top: 20,
          right: 20,
          padding: '10px 20px',
          fontSize: '14px',
          backgroundColor: '#4f46e5',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
        }}
      >
        ログイン
      </button>

      <div style={{ textAlign: 'center', marginTop: '20%' }}>
        <h1 style={{ fontSize: '2.5rem', marginBottom: '1rem' }}>
          ようこそ Tricentis Clone Appへ
        </h1>
        <p style={{ fontSize: '1.2rem' }}>
          テスト自動化学習用のデモアプリです。
        </p>
      </div>
    </div>
  );
}

export default LandingPage;
